function tokenMsg() {
    return "Enter your Nike Bearer Token"
}

function authMsg() {
    return "Click 'Authorize' to Log In to Strava"
}

function convertMsg() {
    return "Select Runs and click 'Convert'"
}

function statusMsg() {
    return "Click 'Status' to check the upload status"
}

export {tokenMsg, authMsg, convertMsg, statusMsg}
